import React from "react";
import "./style.css";

function Footer() {
  return (
    <>
      {/* <footer className="py-4 bg-dark fixed-bottom"> */}
      <footer className="py-4 bg-secondary">
        <div className="container">
          <p className="m-0 text-center text-white">
            Copyright &copy; 2021
          </p>
        </div>
      </footer>
    </>
  );
}

export default Footer;
